import React, {useState} from 'react';
import './Header.css';
import Logo from '../Assets/Images/LOGOs.svg'

function Header() {

    const [triCircleHover, setTriCircleHover] = useState(false);
    const [triCicleActive, setTriCircleActive] = useState(false)

    const tryCircleOver = () => {
        setTriCircleHover(true)
        
    }

    return (
        <div className='header'>
            <div className='band-cont'>
                <img className="brand-logo" src={Logo} alt=""/>
                <h2 className='brand-title'>TORTOISE DIGITAL</h2>
            </div>

            <div onMouseOver={tryCircleOver} className="sb-dot-cont">
                <div className="sb-dot sb-dot-1">
                </div>
                 <div className="sb-dot sb-dot-2">
                </div>
                <div className="sb-dot sb-dot-3">
                </div>
            </div>

            <div className="sidebar">
                <div className="sidebar-container">

                </div>
            </div>
        </div>
    )
}

export default Header;
